import React from 'react'
import  './chart.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


export default function Chart() {
    const data = [
        {
          name: 'Page A',
          "Active Revenue": 4000,
          pv: 2400,
          amt: 2400,
        },
        {
          name: 'Page B',
          "Active Revenue": 3000,
          pv: 1398,
          amt: 2210,
        },
        {
          name: 'Page C',
          "Active Revenue": 2000,
          pv: 9800,
          amt: 2290,
        },
        {
          name: 'Page D',
          "Active Revenue": 2780,
          pv: 3908,
          amt: 2000,
        },
        {
          name: 'Page E',
          "Active Revenue": 1890,
          pv: 4800,
          amt: 2181,
        },
        {
          name: 'Page F',
          "Active Revenue": 2390,
          pv: 3800,
          amt: 2500,
        },
        {
          name: 'Page G',
         "Active Revenue" : 3490,
          pv: 4300,
          amt: 2100,
        },
      ];
    return (
        <div className="chart">
             <h3 className='chartTitle'>Revenue Analysis</h3>
             <ResponsiveContainer width='100%' aspect={4/1}>
                 <LineChart data={data}>
                     <XAxis dataKey="name" stroke="#555"/>
                     <Line type="monotone" dataKey="Active Revenue" stroke="#555"/>
                 </LineChart>

             </ResponsiveContainer>
        </div>
    )
}
